angular.module("starter").factory("Youtube",function($q,$pwaRequest){var factory={extendedOptions:{},genericRequest:function(type,keyword,offset){return $pwaRequest.post("media/mobile_gallery_video_list/proxy-youtube",{data:{type:type,keyword:keyword,offset:offset}})},findBySearch:function(keyword,offset){return factory.genericRequest("search",keyword,offset)},findByChannel:function(keyword,offset){return factory.genericRequest("channel",keyword,offset)},findByUser:function(keyword,offset){return factory.genericRequest("user",keyword,offset)}};return factory});